án configurados para ser entregados mediante a Legacy REST API, que foi eliminada de WooCommerce. Estes webhooks non se enviarán.','Incompatible webhooks warning'=>'Aviso de webhooks incompatibles','This webhook is configured to be delivered using the Legacy REST API, but the Legacy REST API plugin is not installed on this site.'=>'Este webhook está configurado para ser entregado mediante a REST API  herdada, pero o complemento da REST API  herdado non está instalado neste sitio.','block descriptionShows the subtotal, fees, discounts, shipping and taxes.'=>'Mostra o subtotal, cotas, descontos, envíos e impostos.','block titleTotals'=>'Totais','block titleComing Soon'=>'Proximamente','Store coming soon'=>'Tenda proximamente','⚠ <b><a target="_blank" href="%s">The Legacy REST API</a> is active on this site.</b> Please be aware that the WooCommerce Legacy REST API is <b>not</b> compatible with HPOS.'=>'⚠ <b><a target="_blank" href="%s">A API REST</a> herdada está activa neste sitio.</b> Ten en conta que a API REST herdada de WooCommerce <b>non</b> é compatible con HPOS.','⚠ <b><a target="_blank" href="%s">The Legacy REST API plugin</a> is installed and active on this site.</b> Please be aware that the WooCommerce Legacy REST API is <b>not</b> compatible with HPOS.'=>'⚠ <b><a target="_blank" href="%s">O plugin Legacy REST API</a> está instalado e activo neste sitio.</b> Ten en conta que a API REST herdada de WooCommerce <b>non</b> é compatible con HPOS.','Track inventory'=>'Rexistro do inventario','Data in posts table appears to be more recent than in HPOS tables. Compare order data with `wp wc hpos diff %1$d` and use `wp wc hpos backfill %1$d --from=posts --to=hpos` to fix.'=>'Os datos da táboa de publicacións parecen máis recentes que os das táboas HPOS. Compara os datos do pedido con «wp wc hpos diff %1$d» e utiliza «wp wc hpos backfill %1$d --from=posts --to=hpos» para arranxalo.','⚠️ The file system connection could not be initialized.'=>'⚠️ A conexión do sistema de arquivos non se puido inicializar.','You may want to switch to the database for log storage.'=>'Pode que queiras cambiar á base de datos para o almacenamento do rexistro.','⚠️ The file system is not configured for direct writes. This could cause problems for the logger.'=>'⚠️ O sistema de arquivos non está configurado para escribir directamente nel. Isto podería ocasionar problema para o rexistro.','✅ Ready'=>'✅ Listo','Cleanup completed for %d order. Review errors above.'=>'Limpeza completada para %d pedido. Revisa os erros anteriores.' . "\0" . 'Limpeza completada para %d pedidos. Revisa os erros anteriores.','Failed to clean up all orders in a batch. Aborting.'=>'Erro ao limpiar todos os pedidos nun lote. Anulando.','Template namePage: Coming soon'=>'Páxina: Proximamente','Hide shipping costs until an address is entered (Not available when using the <a href="%s">Local pickup options powered by the Checkout block</a>)'=>'Oculta os custos de envío ata que se introduza un enderezo (non está dispoñible cando se utilizan as <a href="%s">opcións de recollida local activadas polo bloque de pago</a>)','<a id="woo-connect-notice-url" href="%s">Connect your store</a> to WooCommerce.com to get updates and streamlined support for your subscriptions.'=>'<a id="woo-connect-notice-url" href="%s">Conecta a túa tenda</a> a WooCommerce.com para obter actualizacións e asistencia optimizada para as túas subscricións.','Your store might be at risk as you are running old versions of WooCommerce plugins.'=>'A túa tenda podería estar en perigo, xa que estás executando versións antigas de plugins de WooCommerce.','Select your shipping options'=>'Selecciona as túas opcións de envío','
