		','Attribution'=>'Atribución','Order attribution information.'=>'Información sobre a atribución do pedido.','Something big is brewing! Our store is in the works and will be launching soon!'=>'Estase cociñando algo grande. A nosa tenda está en obras e pronto abrirá as súas portas.','Great things are on the horizon'=>'Temos grandes proxectos por anunciar','Name of credit cardCartes Bancaires'=>'Cartes Bancaires','There was an error processing your order. Please check for any charges in your payment method and review your <a href="%s">order history</a> before placing the order again.'=>'Produciuse un erro ao procesar o teu pedido. Comproba se hai cargos no teu método de pago e revista o teu <a href="%s">historial de pedidos</a> antes de volver a realizar o pedido.',' <a href="%1$s" class="woocommerce-connect-your-store">Connect your store</a> to woocommerce.com to update.'=>' <a href="%1$s" class="woocommerce-connect-your-store">Conecta a túa tenda</a> a woocommerce.com para actualizar.','block descriptionThe product custom fields.'=>'Os campos personalizados do produto.','block titleProduct custom fields control'=>'Control dos campos personalizados do produto','block keywordfields'=>'campos','block keywordcustom'=>'personalizado','block descriptionThe product custom fields toggle.'=>'O conmutador dos campos personalizados do produto.','block titleProduct custom fields toggle control'=>'Control de conmutación dos campos personalizados do produto','block keywordselect'=>'seleccionar','block descriptionA select field for use in the product editor.'=>'Un campo de selección para utilizalo no editor de produtos.','block titleProduct select field'=>'Campo de selección de produto','Site visibility'=>'Visibilidade do sitio','Live'=>'En directo','Approving will share credentials with %s. Do not proceed if this looks suspicious in any way.'=>'Se das a túa aprobación compartirás as túas credenciais con %s. Non sigas adiante se isto che parece sospeitoso dalgunha maneira.','Plugin installed by %1$s on %2$s.'=>'Plugin instalado por %1$s o %2$s.','Plugin installed by %1$s on %2$s. <a target="_blank" href="%3$s">More information</a>'=>'Plugin instalado por %1$s o %2$s. <a target="_blank" href="%3$s">Máis información</a>','Enter an optional note attached to the order confirmation message sent to the shopper.'=>'Introduce unha nota opcional adxunta á mensaxe de confirmación de pedido enviado ao comprador.','Post-purchase note'=>'Nota de posventa','Custom fields can be used in a variety of ways, such as sharing more detailed product information, showing more input fields, or for internal inventory organization. %1$sRead more about custom fields%2$s'=>'Os campos personalizados poden utilizarse de diversas formas, como para compartir información máis detallada sobre os produtos, amosar máis campos de entrada ou organizar o inventario interno. %1$sMáis información sobre os campos personalizados%2$s','Custom fields'=>'Campos personalizados','Show custom fields'=>'Amosar campos personalizados','Use global attributes to allow shoppers to filter and search for this product. Use custom attributes to provide detailed product information.'=>'Utiliza atributos globais para permitir aos compradores filtrar e buscar este produto. Utiliza atributos personalizados para proporcionar información detallada do produto.','Per your %1$sstore settings%2$s, taxes are not enabled.'=>'Segundo a %1$sconfiguración da túa tenda%2$s, os impostos non están activados.','Unable to create backup post for order %d.'=>'Non se pode crear unha copia de seguridade do pedido %d.','%s is not a valid order property.'=>'%s non é unha propiedade de pedido válida.' . "\0" . '%s non son propiedades de pedido válidas.','%s is an internal meta key. Use --props to set it.'=>'%s é unha clave meta interna. Utiliza --props para configurala.' . "\0" . '%s son claves meta internas. Utiliza --props para configuralas.','The backup datastore does not support updating orders.'=>'O almacén de datos de copia de seguridade non admite a actualización de pedidos.','New custom field name'=>'Novo nome de campo personalizado','Please review the errors above.'=>'Revisa os erros anteriores.','WooCommerce Blocks development mode requires files to be built. From the root directory, run %1$s to ensure your node version is aligned, run %2$s to install dependencies, %3$s to build the files or %4$s to build the files and watch for changes.'=>'O modo de desenvolvemento de WooCommerce Blocks require a creación de arquivos. Desde o directorio raíz, executa %1$s para asegurarte de que a túa versión de node estea aliñada, executa %2$s para instalar dependencias e %3$s para crear os arquivos ou %4$s para crear os arquivos e observar os cambios.','Overriding existing data with an already registered key is not allowed'=>'Substituír os datos existentes cunha clave xa rexistrada non está permitido','Key for the data being registered must be a string'=>'A clave para os datos a rexistrar debe ser unha cadea','The metaboxhidden_product meta from the user metas.'=>'O valor de metadatos metaboxhidden_product dos metadatos dos usuarios.','Set up your payment methods and accept credit and debit cards, cash, bank transfers and money from your Mercado Pago account. Offer safe and secure payments with Latin America’s leading processor.'=>'Configura os teus métodos de pago e acepta tarxetas de crédito e débito, efectivo, transferencias bancarias e diñeiro da túa conta Mercado Pago. Ofrece pagos seguros e protexidos co procesador líder de Latinoamérica.','Mercado Pago'=>'Mercado Pago','Collect sales tax'=>'Recadar o imposto sobre as vendas.','Add your products'=>'Engadir os teus produtos.','Get paid'=>'Recibe os pagos','Grow your business'=>'Facer crecer o teu negocio.','It\'s time to celebrate – you\'re ready to launch your store! Woo! Hit the button to preview your store and make it public.'=>'É hora de celebralo: xa estás a punto para publicar a túa tenda! Bravo! Pulsa o botón para obter unha vista previa da túa tenda e facela pública.','Launch your store'=>'Publicar a túa tenda.','Get your products shipped'=>'Envíar os teus produtos.','Current price is: %s.'=>'O prezo actual é: %s.','Original price was: %s.'=>'O prezo orixinal era: %s.','Checkout can be customized <a href="%s">in the Editor</a> with your active theme.'=>'O pago pódese personalizar <a href="%s">no editor</a> co teu tema activo.','⚠️ WooCommerce attempted to install <a href="%1$s">the Legacy REST API plugin</a> because this site has <a href="%2$s">the Legacy REST API enabled</a> or has <a href="%3$s">legacy webhooks defined</a>, but the installation failed (see error details in <a href="%4$s">the WooCommerce logs</a>). Please install and activate the plugin manually. <a href="%5$s">More information</a>'=>'⚠️ WooCommerce intentou instalar <a href="%1$s">o plugin Legacy REST API</a> porque este sitio ten <a href="%2$s">a API REST herdada activada</a> ou ten <a href="%3$s">webhooks herdados definidos</a>, pero non puido completar a instalación (podes ver os detalles do erro nos <a href="%4$s">rexistros de WooCommerce</a>). Instala e activa o plugin de forma manual. <a href="%5$s">Máis información</a>','ℹ️ WooCommerce installed and activated <a href="%1$s">the Legacy REST API plugin</a> because this site has <a href="%2$s">the Legacy REST API enabled</a> or has <a href="%3$s">legacy webhooks defined</a>. <a href="%4$s">More information</a>'=>'ℹ️ WooCommerce instalou e activou <a href="%1$s">o plugin Legacy REST API</a> porque este sitio ten <a href="%2$s">a API REST herdada activada</a> ou ten <a href="%3$s">webhooks herdados definidos</a>. <a href="%4$s">Máis información</a>','WooCommerce installed the Legacy REST API plugin but failed to activate it, see context for more details.'=>'WooCommerce instalou o plugin Legacy REST API pero non puido activalo. Podes ver o contexto para obter máis información.','⚠️ WooCommerce installed <a href="%1$s">the Legacy REST API plugin</a> because this site has <a href="%2$s">the Legacy REST API enabled</a> or has <a href="%3$s">legacy webhooks defined</a>, but it failed to activate it (see error details in <a href="%4$s">the WooCommerce logs</a>). Please go to <a href="%5$s">the plugins page</a> and activate it manually. <a href="%6$s">More information</a>'=>'⚠️ WooCommerce instalou <a href="%1$s">o plugin Legacy REST API</a> porque este sitio ten <a href="%2$s">a API REST herdada habilitada</a> ou ten <a href="%3$s">webhooks herdados definidos</a>, pero non puido activalo (podes ver os detalles do erro nos <a href="%4$s">rexistros de WooCommerce</a>). Vai á <a href="%5$s">páxina de plugins</a> e actívao de forma manual. <a href="%6$s">Máis información</a>','Please enter a valid email at checkout to use coupon code "%s".'=>'Introduce un enderezo de correo electrónico válido ao realizar a compra para utilizar o código de cupón «%s».','Please enter a valid email to use coupon code "%s".'=>'Introduce un enderezo de correo electrónico válido para utilizar o código de cupón «%s».','To allow logging, make %s writable.'=>'Para permitir o rexistro, fai que %s teña permisos de escritura.','Local pickup: Set up pickup locations in the <a href="%s">Local pickup settings page</a>.'=>'Recollida local: configura as ubicacións de recollida na <a href="%s">páxina de configuración da recollida local</a>.','Explore a new enhanced delivery method that allows you to easily offer one or more pickup locations to your customers in the <a href="%s">Local pickup settings page</a>.'=>'Explora un novo método de entrega mellorado que che permite ofrecer facilmente unha ou máis ubicacións de recollida aos teus clientes na <a href="%s">páxina de configuración da recollida local</a>.','Gathering usage data allows us to tailor your store setup experience, offer more relevant content, and help make WooCommerce better for everyone.'=>'A recompilación de datos de uso permítenos adaptar a experiencia de configuración da túa tenda, ofrecer contido máis relevante e axudar a que WooCommerce sexa mellor para todos.','Please <a href="%1$s">Install the WooCommerce.com Update Manager</a> to continue receiving the updates and streamlined support included in your WooCommerce.com subscriptions. Alternatively, you can <a href="%2$s">download</a> and install it manually.'=>'<a href="%1$s">Instala WooCommerce.com Update Manager</a> para seguir recibindo as actualizacións e a asistencia optimizada incluídas nas túas subscricións a WooCommerce.com. Tamén podes <a href="%2$s">descargar</a> a extensión e instalala manualmente.','Please <a href="%1$s">activate the WooCommerce.com Update Manager</a> to continue receiving the updates and streamlined support included in your WooCommerce.com subscriptions.'=>'<a href="%1$s">Activa WooCommerce.com Update Manager</a> para seguir recibindo as actualizacións e a asistencia optimizada incluídas nas túas subscricións a WooCommerce.com.',' Activate WooCommerce.com Update Manager to update.'=>' Activa WooCommerce.com Update Manager para actualizar.',' <a href="%1$s">Install WooCommerce.com Update Manager</a> to update.'=>' <a href="%1$s">Instala WooCommerce.com Update Manager</a> para actualizar.','block keywordrich-text'=>'rich-text','block keywordtextarea'=>'área de texto','block descriptionA text-area field for use in the product editor.'=>'Un campo de texto para utilizalo no editor de produtos.','block titleProduct textarea block'=>'Bloque da área de texto do produto','block keywordsubsection'=>'subsección','block descriptionThe product subsection description.'=>'A descrición da subsección do produto.','block titleProduct subsection description'=>'Descrición da subsección do produto','Invalid %s provided.'=>'Proporcionouse un %s inválido.','Internal server error'=>'Erro interno do servidor','Sorry, you cannot delete resources.'=>'Síntoo, non podes borrar recursos.','Sorry, you cannot create resources.'=>'Síntoo, non podes crear recursos.','Sorry, you cannot view resources.'=>'Síntoo, non podes ver os recursos.','True to force the creation of a new receipt even if one already exists and has not expired yet.'=>'Verdadeiro para forzar a creación dun novo recibo anque xa exista un e aínda non caducara.','Number of days to be added to the current date to get the expiration date.'=>'Número de días que hai que engadir á data actual para obter a data de caducidade.','Expiration date formatted as yyyy-mm-dd.'=>'Data de caducidade con formato aaaa-mm-dd.','Expiration date of the receipt, formatted as yyyy-mm-dd.'=>'Data de caducidade do recibo con formato aaaa-mm-dd.','Public url of the receipt.'=>'URL pública do recibo.','Unique identifier of the order.'=>'Identificador único do pedido.','Order not found'=>'Pedido non encontrado','Receipt not found'=>'Recibo non encontrado','Account Type'=>'Tipo de conta','AID'=>'AXUDA','Application Name'=>'Nome da aplicación','Payment method'=>'Forma de pago','Date Paid'=>'Data de pago','Amount Paid'=>'Importe pagado','Discount (%s)'=>'Desconto (%s)','Summary: Order #%d'=>'Resumo: pedido n.º %d','Receipt'=>'Recibo','Receipt from %s'=>'Recibo de %s','Background process for coupon meta conversion stopped'=>'Detenido o proceso en segundo plano para a metaconversión de cupóns','Background process for coupon meta conversion not started, nothing done.'=>'Non se iniciou o proceso en segundo plano para a metaconversión de cupóns, non se fixo nada.','Background process for coupon meta conversion started'=>'Iniciado o proceso en segundo plano para a metaconversión de cupóns','Background process for coupon meta conversion already started, nothing done.'=>'O proceso en segundo plano para a metaconversión de cupóns comezou, non se fixo nada.','This will convert <code>coupon_data</code> order item meta entries to simplified <code>coupon_info</code> entries. The conversion will happen overtime in the background (via Action Scheduler). There are currently %d entries that can be converted.'=>'Converteranse entradas meta de elementos de pedido <code>coupon_data</code> en entradas de <code>coupon_info</code> simplificadas. A conversión irase producindo en segundo plano (a través do programador de accións). Actualmente, hai %d entradas que poden converterse.','Convert order coupon data to the simplified format'=>'Convirte os datos do cupón de pedido ao formato simplificado','This will stop the background process that converts <code>coupon_data</code> order item meta entries to simplified <code>coupon_info</code> entries. There are currently %d entries that can be converted.'=>'Isto deterá o proceso en segundo plano que convirte as metaentradas dos artigos de pedido <code>coupon_data</code> en entradas simplificadas de <code>coupon_info</code>. Actualmente hai %d entradas que se poden converter.','Stop converting'=>'Deixa de converter','Stop converting order coupon data to the simplified format'=>'Deixar de converter os datos dos cupóns de pedido ao formato simplificado','This will convert <code>coupon_data</code> order item meta entries to simplified <code>coupon_info</code> entries. The conversion will happen overtime in the background (via Action Scheduler). There are currently no entries to convert.'=>'Converteranse entradas meta de elementos de pedido <code>coupon_data</code> en entradas de <code>coupon_info</code> simplificadas. A conversión irase producindo en segundo plano (a través do programador de accións). Actualmente, non hai entradas que poidan converterse.','Start converting'=>'Empezar a converter','Start converting order coupon data to the simplified format'=>'Empezar a converter os datos dos cupóns de pedido ao formato simplificado','A font family with slug "%s" already exists.'=>'Xa existe unha familia de fontes co slug «%s».','The font family preview is required.'=>'Requírese a vista previa da familia de fontes.','The font family name is required.'=>'Requírese o nome da familia de fontes.','The font face src is required.'=>'É necesario a orixe (src) do tipo de letra.','The