rsion of WooCommerce does not support template cache clearing.'=>'A versión activa de WooCommerce non é compatible coa limpieza de caché dos modelos.','Template cache cleared.'=>'A caché do modelo baleirouse.','Verify if all base database tables are present.'=>'Verifica se todas as táboas da base de datos base están presentes.','Verify database'=>'Verificar base de datos','Verify base database tables'=>'Verificar as táboas da base de datos base','This tool will empty the template cache.'=>'Esta ferramenta baleirará a caché do modelo.','Clear template cache'=>'Baleirar a caché do modelo','Collect and validate EU VAT numbers at checkout'=>'Recompila e valida os números de IVE da UE ao finalizar a compra','If your store is based in the EU, we recommend using the EU VAT Number extension in addition to automated taxes. It provides your checkout with a field to collect and validate a customer\'s EU VAT number, if they have one.'=>'Se a túa tenda está ubicada na UE, recomendamos utilizar a extensión do número de IVE da UE ademais dos impostos automatizados. Proporciona aos teus pagos un campo para recompilar e validar o número de IVE da UE dun cliente, se ten un.','Get real-time order alerts anywhere'=>'Recibe alertas de pedidos en tempo real en calquera lugar','Get notifications about store activity, including new orders and product reviews directly on your mobile devices with the Woo app.'=>'Recibe avisos sobre a actividade da tenda, incluídos novos pedidos e valoracións de produtos directamente nos teus dispositivos móbiles coa aplicación Woo.','First order received'=>'Primeiro pedido recibido','This video tutorial will help you go through the process of adding your first product in WooCommerce.'=>'Este tutorial en video axudarache no proceso de engadir o teu primeiro produto en WooCommerce.','Do you need help with adding your first product?'=>'Necesitas axuda para engadir o teu primeiro produto?','Starting a fashion website is exciting but it may seem overwhelming as well. In this article, we\'ll walk you through the setup process, teach you to create successful product listings, and show you how to market to your ideal audience.'=>'Iniciar unha web de moda é emocionante, pero tamén pode parecer abrumador. Neste artigo, guiarémoste a través do proceso de configuración, ensinarémosche a crear listas de produtos exitosas e mostrarémosche como comercializar á túa audiencia ideal.','Start your online clothing store'=>'Inicia a túa tenda de roupa en liña','The admin note layout has a wrong prop value.'=>'O deseño da nota de administrador ten un valor de referencia incorrecto.','Watch tutorial'=>'Ver o titorial','Share feedback'=>'Compartir comentarios','Now that you’ve chosen us as a partner, our goal is to make sure we\'re providing the right tools to meet your needs. We\'re looking forward to having your feedback on the store setup experience so we can improve it in the future.'=>'Agora que nos elixiches como socio, o noso obxectivo é asegurarnos de que che estamos proporcionando as ferramentas adecuadas para satisfacer as túas necesidades. Esperamos recibir os teus comentarios sobre a experiencia de configuración da tenda para que poidamos mellorala no futuro.','Changing eCommerce platforms might seem like a big hurdle to overcome, but it is easier than you might think to move your products, customers, and orders to WooCommerce. This article will help you with going through this process.'=>'Cambiar entre plataformas de comercio electrónico pode parecer un gran obstáculo que superar, pero mover os teus produtos, clientes e pedidos a WooCommerce é máis fácil do que poderías pensar. Este artigo axudarache con este proceso.','Do you want to migrate from Shopify to WooCommerce?'=>'Queres migrar de Shopify a WooCommerce?','WooCommerce Subscriptions allows you to introduce a variety of subscriptions for physical or virtual products and services. Create product-of-the-month clubs, weekly service subscriptions or even yearly software billin