 pedidos!','Review'=>'Valoración','Activate usage tracking'=>'Activar o seguimento de uso','Gathering usage data allows us to improve WooCommerce. Your store will be considered as we evaluate new features, judge the quality of an update, or determine if an improvement makes sense. You can always visit the %1$sSettings%3$s and choose to stop sharing data. %2$sRead more%3$s about what data we collect.'=>'Recompilar datos de uso permítenos mellorar WooCommerce. Terase en conta a túa tenda a medida que evaluamos novas características, xulgamos a calidade dunha actualización ou determinamos se unha mellora ten sentido. Sempre podes visitar os %1$sAxustes%3$s e elixir deixar de compartir datos. %2$sLe máis%3$s sobre os datos que recopimlamos.','The admin note action label prop cannot be empty.'=>'A propiedade «action label» da nota de administración non pode estar baleira.','The admin note action name prop cannot be empty.'=>'A propiedade «action name» da nota de administración non pode estar baleira.','The admin note date prop cannot be empty.'=>'A propiedade «date» da nota de administración non pode estar baleira.','The admin note source prop cannot be empty.'=>'A propiedade «source» da nota de administración non pode estar baleira.','The admin note status prop (%s) is not one of the supported statuses.'=>'A propiedade «status» (%s) da nota de administración non é un dos estados compatibles.','The admin note status prop cannot be empty.'=>'A propiedade «status» da nota de administración non pode estar baleira.','The admin note content_data prop must be an instance of stdClass.'=>'A propiedade «content_data» da nota de administracion debe ser unha instancia de stdClass.','The admin note content prop cannot be empty.'=>'A propiedade «content» da nota de administración non pode estar baleira.','The admin note title prop cannot be empty.'=>'A propiedade «title» da nota de administración non pode estar baleira.','The admin note locale prop cannot be empty.'=>'A propiedade «l