isco ','I have read and agree to the website %s'=>'Lin e estou de acordo cos %s da web','Required'=>'Obrigatorio ','%s field'=>'Campo %s ','These options let you change the appearance of the WooCommerce checkout.'=>'Estas opcións permítenche cambiar a aparencia da páxina de finalizar compra de WooCommerce. ','Please see the <a href="https://www.paypal.com/us/webapps/mpp/ua/privacy-full">PayPal Privacy Policy</a> for more details.'=>'Por favor, revisa a <a href="https://www.paypal.com/us/webapps/mpp/ua/privacy-full">política de privacidade de PayPal</a> para máis detalles. ','We accept payments through PayPal. When processing payments, some of your data will be passed to PayPal, including information required to process or support the payment, such as the purchase total and billing information.'=>'ceptamos pagos mediante PayPal. Ao procesar pagos algúns dos teus datos pasaranse a PayPal, incluída a información requirida para procesar ou dar soporte ao pago, tales como o total da compra e a información de facturación. ','In this subsection you should list which third party payment processors you’re using to take payments on your store since these may handle customer data. We’ve included PayPal as an example, but you should remove this if you’re not using PayPal.'=>'Nesta subsección deberías apuntar que outros procesadores de pago externos estás a usar para admitir pagos na túa tenda, xa que poida que manexen datos dos clientes. Incluímos PayPal como exemplo, pero deberías borralo se non estás a usar PayPal. ','We share information with third parties who help us provide our orders and store services to you; for example --'=>'Compartimos información con outros, que nos axudan a ofrecer os nosos pedidos e xestionar servizos para ti; por exemplo -- ','In this section you should list who you’re sharing data with, and for what purpose. This could include, but may not be limited to, analytics, marketing, payment gateways, shipping providers, and third party embeds.'=>'Nesta 