remos información dos pedidos durante XXX anos para propósitos de impostos e contabilidade. Isto inclúe o teu home, enderezo de correo electrónico e enderezos de facturación e envío. ','If you create an account, we will store your name, address, email and phone number, which will be used to populate the checkout for future orders.'=>'Se creas unha conta almacenaremos o teu nome, enderezo, correo electrónico e número de teléfono, que usaremos para o proceso de pago e futuros pedidos. ','Send you marketing messages, if you choose to receive them'=>'Enviarche mensaxes promocioniales, se ecsolles recibilos','Improve our store offerings'=>'Mellorar as ofertas da nosa tenda ','Comply with any legal obligations we have, such as calculating taxes'=>'Cumprir con calquera obrigación legal que teñamos, como cálculos de impostos ','Set up your account for our store'=>'Configurar a túa conta para a nosa tenda','Process payments and prevent fraud'=>'Procesar pagos e evitar a fraude ','Respond to your requests, including refunds and complaints'=>'Responder as túas solicitudes, incluídos reembolsos e reclamacións ','Send you information about your account and order'=>'Enviarche información sobre a túa conta e pedido ','When you purchase from us, we’ll ask you to provide information including your name, billing address, shipping address, email address, phone number, credit card/payment details and optional account information like username and password. We’ll use this information for purposes, such as, to:'=>'Cando nos compras algo pedímosche que facilites información que inclúe o teu nome, enderezo de facturación, enderezo de envío, enderezo de correo electrónico, número de teléfono, detalles do cartón bancario/pagamento e información adicional opcional como o nome de usuario e o contrasinal. Usaremos esta información para propósitos como: ','Note: you may want to further detail your cookie policy, and link to that section from here.'=>'Observación: poida que queiras detallar a túa política de cookies, e enlazar desde aquí a esta sección. ','We’ll also use cookies to keep track of cart contents while you’re browsing our site.'=>'Tamén usamos cookies para realizar o seguimento dos contidos do carriño mentres navegas polo noso sitio. ','Shipping address: we’ll ask you to enter this so we can, for instance, estimate shipping before you place an order, and send you the order!'=>'Enderezo de envío: pedirémosche que facilites isto para que poidamos, por exemplo, estimar o custo do envío antes de que fagas un pedido, e enviarche o pedido! ','Location, IP address and browser type: we’ll use this for purposes like estimating taxes and shipping'=>'Localización, enderezo IP e tipo de navegador: usaremos isto para propósitos como estimar impostos e custos de envío ','Products you’ve viewed: we’ll use this to, for example, show you products you’ve recently viewed'=>'Os produtos que viches: usaremos isto para, por exemplo, mostrarche produtos que viches recentemente ','While you visit our site, we’ll track:'=>'Mentres visitas o noso sitio realizaremos o seguimento de: ','What we collect and store'=>'O que recompilamos e almacenamos','We collect information about you during the checkout process on our store.'=>'Recompilamos información túa durante o proceso de pago na nosa tenda. ','This sample language includes the basics around what personal data your store may be collecting, storing and sharing, as well as who may have access to that data. Depending on what settings are enabled and which additional plugins are used, the specific information shared by your store will vary. We recommend consulting with a lawyer when deciding what information to disclose on your privacy policy.'=>'Este texto de mostra inclúe os básicos sobre que datos persoais recompila, almacena e comparte a túa tenda, así como quen ten acceso a eses datos. Dependendo de que axustes estean activos e que plugins adicionais se usane, a información específica compartida pola túa tenda pode variar. Recomendámosche que consultes a un avogado para decidir que información mostrar na túa política de privacidade.','Token'=>'Token','Payment Tokens'=>'Tokens de pago','Access granted'=>'Acceso concedido ','Download count'=>'Contador de descargas ','User email'=>'Correo electrónico do usuario ','Browser User Agent'=>'Navegador do usuario','Items Purchased'=>'Produtos comprados ','Order Number'=>'Número de pedido','Download ID'=>'ID da descarga ','Access to Purchased Downloads'=>'Acceso ás descargas compradas ','Purchased Downloads'=>'Descargas compradas ','Customer Data'=>'Datos do cliente ','Removed payment token "%d"'=>'Eliminado o token de pago "%d" ','Personal data removed.'=>'Datos persoais borrados. ','Customer download permissions have been retained.'=>'Os permisos de descarga do cliente conserváronse.','Removed access to downloadable files.'=>'Eliminado o acceso aos arquivos descargables. ','Personal data within order %s has been retained.'=>'Os datos persoais do pedido %s conserváronse.','Removed personal data from order %s.'=>'Eliminados os datos persoais do pedido %s. ','Removed customer "%s"'=>'Eliminado o cliente "%s" ','Shipping State'=>'Provincia do envío ','Shipping Postal/Zip Code'=>'Código postal do envío ','Shipping City'=>'Cidade do envío ','Shipping Company'=>'Empresa do envío','Shipping Last Name'=>'Apelidos do envío','Shipping First Name'=>'Nome do envío','Phone Number'=>'Número de teléfono','Billing State'=>'Provincia de facturación ','Billing Postal/Zip Code'=>'Código postal de facturación','Billing City'=>'Cidade de facturación ','Billing Company'=>'Empresa de facturación','Billing Last Name'=>'Apelidos de facturación ','Billing First Name'=>'Nome de facturación ','Error during status transition.'=>'Erro durante o cambio de estado. ','Update status event failed.'=>'Fallou o evento de actualización de estado.','Payment complete event failed.'=>'Fallou o evento de completar o pago.','User roleShop manager'=>'Xestor da tenda','User roleCu