 pedidos coa información completa durante un tempo especificada antes de anonimizar os datos persoais que conteñan. ','Retain completed orders'=>' 	Conservar pedidos completados ','Cancelled orders are unpaid and may have been cancelled by the store owner or customer. They will be trashed after the specified duration.'=>'Os pedidos cancelados están sen pagar e poderían ter sido cancelados polo dono da tenda ou o cliente. Enviaranse á papeleira trala duración especificada.','Retain cancelled orders'=>'Conservar pedidos cancelados ','Failed orders are unpaid and may have been abandoned by the customer. They will be trashed after the specified duration.'=>'Os pedidos errados están sen pagar e poderían ser abandonados polo cliente. Enviaranse á papeleira tras a duración especificada. ','Retain failed orders'=>'Conservar pedidos errados ','Pending orders are unpaid and may have been abandoned by the customer. They will be trashed after the specified duration.'=>'Os pedidos pendentes están sen pagar e poderían ser abandonados polo cliente. Enviaranse á papeleira tras a duración especificada. ','Retain pending orders '=>'Conservar pedidos pendentes ','Inactive accounts are those which have not logged in, or placed an order, for the specified duration. They will be deleted. Any orders will be converted into guest orders.'=>'Contas inactivas son as que non accederon, ou realizado algún pedido, durante unha duración especificada. Borraranse. Calquera pedido converterase en pedido de invitado.','Retain inactive accounts '=>'Conservar contas inactivas ','Choose how long to retain personal data when it\'s no longer needed for processing. Leave the following options blank to retain this data indefinitely.'=>'Escolle canto tempo tempo conservar os datos persoais cando xa non sexa necesario procesalos. Deixa as seguintes opcións en branco para conservar estes datos indefinidamente. ','Personal data retention'=>'Conservación de datos persoais ','Your personal data will be used to process your order, support your experience throughout this website, and for other purposes described in our %s.'=>'Os teus datos persoais utilizaranse para procesar o teu pedido, mellorar a túa experiencia nesta web e outros propósitos descritos en nosa %s. ','Optionally add some text about your store privacy policy to show during checkout.'=>'Opcionalmente, engade algo de texto sobre a política de privacidade da túa tenda, que se mostrará ao finalizar compra. ','Checkout privacy policy'=>'Política de privacidade ao finalizar compra ','Your personal data will be used to support your experience throughout this website, to manage access to your account, and for other purposes described in our %s.'=>'Os teus datos persoais utilizaranse para procesar o teu pedido, mellorar a túa experiencia nesta web, xestionar o acceso á túa conta e outros propósitos descritos en nosa %s. ','Optionally add some text about your store privacy policy to show on account registration forms.'=>'Opcionalmente, engade algo de texto sobre a política de privacidade da túa tenda, que se mostrará nos formularios de rexistro da conta. ','Registration privacy policy'=>'Política de privacidade no rexistro ','privacy page'=>'Páxina de privacidade ','This section controls the display of your website privacy policy. The privacy notices below will not show up unless a %s is set.'=>'Esta sección controla a visualización da política de privacidade da túa web. Os seguintes avisos de privacidade non se mostrarán a menos que se estableza unha %s.','Privacy policy'=>'Política de privacidade ','Removed personal data from %s order.'=>'Elimináronse os datos persoais do pedido %s.' . "\0" . 'Elimináronse os datos persoais dos pedidos %s.','Account erasure requests'=>' 	Solicitudes de borrado de conta ','Accounts &amp; Privacy'=>' 	Contas e privacidade ','List of allowed billing emails to check against when an order is placed. Separate email addresses with commas. You can also use an asterisk (*) to match parts of a