ugin.','Remote get'=>'Obtención remota','Error: %s'=>'Erro: %s','PayPal uses this method of communicating when sending back transaction information.'=>'PayPal utiliza este método de comunicación ao enviar de novo a información das transaccións.','Remote post'=>'Publicación remota','GZip (gzopen) is used to open the GEOIP database from MaxMind.'=>'Úsase Gzip (gzopen) para abrir a base de datos GEOIP de MaxMind.','Your server does not have the %s class enabled - HTML/Multipart emails, and also some extensions, will not work without DOMDocument.'=>'O teu servidor non ten activa a clase %s - os correos electrónicos HTML/Multiparte, e tamén algunhas extensións, non funcionarán sen o DOMDocument.','HTML/Multipart emails use DOMDocument to generate inline CSS in templates.'=>'Correos electrónicos HTML/multiparte utilizan DOMDocument para xerar CSS en liña nos modelos.','Some webservices like shipping use SOAP to get information from remote servers, for example, live shipping quotes from FedEx require SOAP to be installed.'=>'Algúns servicios web como o envío usan SOAP para obter información dos servidores remotos, por exemplo, os gastos de envío de FedEx en vivo requiren SOAP para instalarse.','Your server does not have fsockopen or cURL enabled - PayPal IPN and other scripts which communicate with other servers will not work. Contact your hosting provider.'=>'O teu servidor non ten activado fsockopen ou CURL - PayPal IPN e outras secuencias de comandos que se comunican con outros servidores non funcionarán. Ponte en contacto co teu provedor de aloxamiento.','Payment gateways can use cURL to communicate with remote servers to authorize payments, other plugins may also use it when communicating with remote services.'=>'As pasarelas de pago poden utilizar CURL para comunicarse con servidores remotos para autorizar os pagos, outros plugins tamén poden utilizalo na comunicación cos servicios remotos.','Default timezone is %s - it should be UTC'=>'Por defecto a zona horaria é %